import React from "react";
import contacts from "./contacts";

const Card = () => {
  const handleBookNow = (link) => {
    window.open(link, "_blank"); // Opens the link in a new tab
  };

  return (
    <div className="card">
      <div className="top">
        <div className="circle-img"></div>
        <div className="name">
          <img src={d6} alt="Profile" className="card-img" />
          <span>{contacts[0].name}</span>
        </div>
      </div>
      <div className="bottom">
        <div>{contacts[0].price}</div>
        <button onClick={() => handleBookNow(contacts[0].bookNowLink)}>
          Book Now
        </button>
      </div>
    </div>
  );
};

export default Card;
